INSERT INTO `banner` VALUES (1, 'TangBoy', 'www.baidu.com', '/uploads/images/2019/0520/1f5ca135-d64c-47a3-965a-8c168b289584.jpg', 1, 1, '一个后端程序员的个人博客，记录博主的学习,生活中的一些有趣的事，并分享后端方面技术和源码。', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 14px; text-align: center; text-indent: 28px; background-color: rgb(255, 255, 255);\">博客是一个由后端开发的个人博客网站，诞生于2019年5月17日，前端页面使用“Absolutely”大神提供的前端模板页面，以及大量的LayerUI组件，网站架构使用springboot+spring date jpa+shiro+Redis+Tomcat架构 ，后台部分页面的布局使用fsLayui框架模板。目前大体的主要功能已经完成，后续将会继续完善功能和页面的优化！</span></p>', '2019-05-20 15:17:22', '2019-05-20 15:24:36', NULL);
INSERT INTO `banner` VALUES (2, 'TangBoy', 'www', '/uploads/images/2019/0520/3a4b802f-d733-4c18-b2a1-b1dd332a913a.jpg', 99, 2, '一枚90后程序员，后端开发工程师，主攻后端，略懂Web前端', '<p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 14px; text-align: center; text-indent: 2em; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">诞生于1997年，目前是一个码农，从事Java方向的研究和开发。</p><h1 style=\"margin: 25px 0px 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 16px; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">个人信息</h1><p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 14px; text-indent: 2em; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">一个喜欢旅游，喜欢在路上的感觉！喜欢民谣音乐的程序猿~(偶尔会跟大家分享一些好听的民谣音乐，在本站我也会推荐，喜欢的可以关注我的网易云，收藏我自己整理的歌单：蓝色牛仔裤丶)</p><h1 style=\"margin: 25px 0px 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 16px; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">个人介绍</h1><p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 14px; text-indent: 2em; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">暂无</p><h1 style=\"margin: 25px 0px 0px; padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 16px; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">未来</h1><p style=\"padding: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); font-size: 14px; text-indent: 2em; color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">还没想好...</p><p><br/></p>', '2019-05-20 15:33:03', '2019-05-22 21:47:38', 'TangBoy，一枚90后的后端程序员，好奇心比较强，目前是一个码农，从事go+php方向的研究和开发。-- Tang');
INSERT INTO `banner` VALUES (3, '友情链接', 'Name：TangBoy博客    Site：www.long225.cn', '/uploads/images/2019/0520/f575c1bb-a7b0-4400-b609-429aad1fdf4a.png', 99, 3, '<i class=\"fa fa-close\"></i>经常宕机<i class=\"fa fa-close\"></i>不合法规<i class=\"fa fa-close\"></i>插边球站<i class=\"fa fa-close\"></i>红标报毒<i class=\"fa fa-check\"></i>原创优先<i class=\"fa fa-check\"></i>技术优先', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 28px; text-align: center; background-color: rgb(255, 255, 255);\">互换友链，携手并进！</span></p>', '2019-05-20 15:35:01', '2019-05-20 15:35:46', NULL);
