INSERT INTO `blog_article` VALUES (10, '学霸君CEO张凯磊出席“AI与大数据助力教与学论坛”', NULL, NULL, 'uploads/20180713/20180713210551953.jpg', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; color: rgb(66, 66, 66); font-size: 1pc; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;, &quot;PingFang SC&quot;, &quot;HanHei SC&quot;, Arial; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">2018年4月16日，由中国教育学会联合在线教育平台学霸君共同举办的“AI与大数据助力教与学论坛”在北京国家会议中心举行。学霸君创始人张凯磊出席了本次活动，带来了“人工智能如何提升教学效率”的主题分享。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; color: rgb(66, 66, 66); font-size: 1pc; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;, &quot;PingFang SC&quot;, &quot;HanHei SC&quot;, Arial; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">出席本次论坛的还有中国教育考试指导委员会委员戴家干、人大附中总校信息中心主任赵海涛、北京师范大学副教授李玉顺等行业领导、业内知名企业创始人、各大院校代表、媒体代表等。</p>', '白衣少侠', 0, 1531128706, 99, 9, NULL, '2018-07-09 17:31:46', '2018-07-13 21:05:56');
INSERT INTO `blog_article` VALUES (11, '洛洛历险记', '动画', '游戏', 'uploads/default.jpg', '<p><span style=\"color: rgb(77, 77, 77); font-family: -apple-system, &quot;Helvetica Neue&quot;, Helvetica, &quot;Nimbus Sans L&quot;, Arial, &quot;Liberation Sans&quot;, &quot;PingFang SC&quot;, &quot;Hiragino Sans GB&quot;, &quot;Source Han Sans CN&quot;, &quot;Source Han Sans SC&quot;, &quot;Microsoft YaHei&quot;, &quot;Wenquanyi Micro Hei&quot;, &quot;WenQuanYi Zen Hei&quot;, &quot;ST Heiti&quot;, SimHei, &quot;WenQuanYi Zen Hei Sharp&quot;, sans-serif; font-size: 14px; letter-spacing: 1px;\">《洛洛历险记》是我国第一部以变形机器人为主角的大型动画片，完美融合了中国传统武术精髓。主人公“洛洛”，是一个游戏高手，他最擅长玩一个名为“机战王”的电脑游戏。在一个雷电交加的夜晚他突然进入机战王的游戏世界，并成为游戏中机车族的机战王（领袖），一场关于机器人的战役全面打响了。</span></p>', '白衣少侠', 0, 1533607067, 99, 18, NULL, '2018-08-07 09:57:47', '2018-08-07 09:58:45');
INSERT INTO `blog_article` VALUES (12, '微信公众平台：8月8日开始剔除非自然阅读数据', '新闻', '发现微信公众平台上多了一个公告，公告显示微信将于8月8日开始剔除由机器带来的非自然阅读数据，因此会造成新的统计数据与历史数据对比出现一定波动', 'uploads/default.jpg', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; color: rgb(66, 66, 66); font-size: 1pc; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;, &quot;PingFang SC&quot;, &quot;HanHei SC&quot;, Arial; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-weight: 700;\">以下为公告全文：</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 10px 0px; color: rgb(66, 66, 66); font-size: 1pc; line-height: 30px; font-family: &quot;Microsoft Yahei&quot;, &quot;PingFang SC&quot;, &quot;HanHei SC&quot;, Arial; text-align: justify; white-space: normal; background-color: rgb(255, 255, 255);\">为保证平台的健康运营，公众号运营后台的文章阅读数据于8月8日开始，剔除机器等非自然阅读带来的虚假数据。因统计口径切换，新的统计数据与历史数据对比可能会出现一定波动，该变动对运营者流量不产生实际影响，请运营者留意。</p>', '白衣少侠', 0, 1533611444, 99, 9, NULL, '2018-08-07 11:10:44', '2018-08-07 11:10:44');
